<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Timesheet Punch</title>
    <script src="nms-timesheet.js" defer></script>
    <style>
        body  { font-family: Arial, sans-serif; 
                width: 250px; 
                padding: 14px;
                border-bottom-right-radius: 35px;
                border-bottom-right-radius: 35px;
                }
         
        h1    { font-size: 16px; 
                font-weight: 700; 
                color: rgb(9,9,11);
                margin-bottom: 14px;
                text-decoration: none;
                text-align: center;
                }
        a {
            text-decoration: none;
            color: rgb(9,9,11);
        }
        input { display: block; 
                width: 232px;
                border-radius: 6px;
                border: 1px solid #ccc;
                margin-top: 8px; margin-bottom: 14px;
                padding-top: 14px; padding-bottom: 14px; padding-left: 10px;
                font-size: 14px; font-weight: 400;
                cursor: text;
                }

        label { font-size: 14px; 
                font-weight: 500; 
                color: rgb(9,9,11);
              }

        button { display: block; 
                        margin: 5px 0; 
                        width: 100%; 
                        border-radius: 35px;
                        border: none;
                        padding: 14px;
                        font-weight: bolder;
                        box-shadow: rgba(0, 0, 0, 0.35) 0px 1px 3px;
                        font-size: 14px;
                        cursor: pointer;
               }

        body.dark { 
                background-color: rgb(32, 33, 36);
            }
        body.dark h1,
        body.dark label,
        body.dark a {
            color: #fff;
        }

        body.dark input {
            background-color: rgb(32, 33, 36);
            border-color: rgb(95, 99, 104);
            color: #fff;
        }


        #logo { display: block; 
                margin: 0 auto;
                width: 145px;
                height: 140px;
                margin-top: 14px;
                margin-bottom: 35px;
                color:#f00;
                }
    
        #punchout { background-color: #f00; 
                    color: #fff;
                    margin-top: 35px;
                }
        #punchin { background-color: rgb(34,197,94);
                    color: #fff;
                    margin-top: 35px;
                  }
        #updateKey { background-color: rgb(9,9,11);
                    color: #fff;
                    margin-top: 35px;
                  }
        #punchout-form, #punchUpdatekeyForm, punchin-form { display: none; }

        body.dark button {
            background-color: rgb(95, 99, 104);
            color: #fff;
        }

        body.dark #punchout { 
            background-color: #f00;
        }

        body.dark #punchin { 
            background-color: rgb(34,197,94);
        }

        body.dark #updateKey { 
            background-color: rgb(95, 99, 104);
        }

        /* Light/Dark mode SVG logo */
        body.dark #logo {
            color: #fff;
        }

    </style>
</head>
